(20, 'demo@demo.com', 'admin', 'Waiting For Parts', '<table border="0" cellpadding="5" cellspacing="0" style="border: 1px solid rgb(109, 146, 201);" width="662">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2">\r\n				<img alt="" src="http://192.168.0.114/outbox/images/logo.png" style="width:181px; height:100px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				<span style="font-size:14px;"><span style="color: rgb(0, 0, 0);">Dear </span><span style="color:#008000;"><strong>%AdminName% </strong></span><span style="color: rgb(0, 0, 0);">,</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				<span style="font-size:14px;">The &nbsp;Customer :</span><strong style="color: rgb(0, 128, 0); font-size: 14px;">%CustomerName%&nbsp;</strong> is Waiting For Parts.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				<span style="font-size:14px;">The work order <span style="color:#008000;"><strong>%WorkOrder%</strong></span>&nbsp;of the client <span style="color:#008000;"><strong>%ClientName%</strong></span> was assigned to the tech.</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				<p>\r\n					&nbsp;</p>\r\n				<p>\r\n					<br />\r\n					<span style="font-size:14px;"><span style="color: rgb(0, 0, 0);"><strong>Thank you,<br />\r\n					</strong></span><strong><span style="color: rgb(0, 0, 0);">Out Of The Box</span></strong><br />\r\n					<span style="color: rgb(0, 0, 0);"><strong> Email : </strong></span><strong><a href="mailto:support@obs.com"><span style="color: rgb(0, 0, 0);">xxx@xxx.com</span></a></strong></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '2014-07-19'),
(21, 'demo@demo.com', 'Out Of The Box', 'COD Order Scheduled', '<table border="0" cellpadding="5" cellspacing="0" style="border: 1px solid rgb(109, 146, 201);" width="662">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2">\r\n				<img alt="" src="http://192.168.0.114/outbox/images/logo.png" style="width:181px; height: 100px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td width="20">\r\n				&nbsp;</td>\r\n			<td>\r\n				Valued User&nbsp; <span style="color:#008000;"><strong>%Name% </strong></span><span style="color: rgb(0, 0, 0);">,</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				Your work order has been scheduled by one of our Tech and the work will done very soon. Please respond to Tech call and co-operate him to finish the work .</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				If any problem contact us immediately.</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				<p>\r\n					<br />\r\n					<span style="color: rgb(0, 0, 0);"><strong>Thank you,</strong></span><br />\r\n					<span style="color: rgb(0, 0, 0);"><strong>Out Of The Box<br />\r\n					Email :&nbsp;</strong></span><strong style="color: rgb(0, 0, 0);">&nbsp;admin@box-ware.com</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '2015-10-31');
